import React, { Component } from 'react';
import Link from 'next/link';

// Components
import Search from '../Search';

// Style
import { Container, Content, BackDrop, Header } from './styles';

const MobileModal = props => {
	return (
		<Container>
			<BackDrop onClick={() => props.handleMobileModal()} />
			<Content>
				<Search />
				<Link href="/">
					<a>Login</a>
				</Link>
				<Link href="/">
					<a>Store</a>
				</Link>
				<Link href="/">
					<a>Library</a>
				</Link>
				<Link href="/">
					<a>Community</a>
				</Link>
				<Link href="/">
					<a>Support</a>
				</Link>
			</Content>
		</Container>
	);
};

export default MobileModal;
